import React, { Component } from 'react';
import {Button, Input} from 'reactstrap';
import DatePicker from "react-datepicker";


class Fdates extends Component {

    constructor(props) {
        super(props);
        this.state = {
          startDate: new Date(),
          endDate: new Date()
        };

        this.handleStartChange = date => {
          this.setState({
            startDate: date,
          });


      }

      this.handleEndChange = date => {
        this.setState({
          endDate: date,
        });
    }
  }
    render() {
        return (

        <div className="animated fadeIn">

                <br />  

                <strong>Get Reports Weekly/ Monthly Wise</strong><br/>
                <hr/>
                <div className="dates">
                <FormGroup row>
                    <Col md="2">
                    <strong><Label htmlFor="date-input">Enter Start </Label> </strong>
                    </Col>
                    <Col xs="12" md="9">
                      <Input type="date" id="log-input" name="date-input" placeholder="date" />
                    </Col>
                </FormGroup>
                 &nbsp;&nbsp;&nbsp; <Button type="submit" size="sm" color="primary">Apply  <i className="nav-icon icon-check"></i> </Button>
                 </div>
                <hr/>


      </div>

        );
    }
}
export default Fdates;
